import React from "react";
import Heading from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes";
function MakeNotes(prop){
  return <Note title={prop.title} content={prop.content} />;
}
function App(){
  return <div>
  <Heading />
  {notes.map(MakeNotes)}
  <Footer />
  </div>
}
export default App;
